import React from 'react';
import './marker.css';
class CustomMarker extends React.Component {
    render() {
        return (
            <div className="marker"
            style={{ backgroundColor: this.props.color, cursor: 'pointer'}}
            title={this.props.position.latitude}
        />)
    }
}

export default CustomMarker;
